import React from 'react';

import containerStyle from "./topTitle.module.css";
import buttonAddTask from "./buttonAddTask";
const topTitle = () => {
  return (
    <div className={containerStyle.topTitle}>
      <h2>Task List</h2>
      {buttonAddTask}
    </div>
  );
};

export default topTitle;
